import React, { Component } from 'react';



export default class Worksingle extends Component {
    render() {
      const { id, projectCategory, projectTitle, projectDescription } = this.props.project;
      //projectImage
      return (
            <ProductConsumer>
            {(value) =>(

                <div className="blog" 
                onClick={()=> value.handleDetail(id)}>
                <Link to="/Blogpage" className="Links">
                <h2>{projectCategory}</h2>
                <h3>{projectTitle}</h3>
                <p>{projectDescription}</p>
                </Link>
                </div>


            )}

            </ProductConsumer>

      );
    }
  }
